import React from 'react';
//import loginImg from '../../login.svg';

class Register extends React.Component{

    constructor(){
        super();
        this.state={
            id: null,
            name: null,
            username: null,
            email: null,
            password: null,
        }
    }

    render(){
        return(
            <div className='base-container'>
                <div className='header'>Register</div>
                <div className='content'>
                    <div className='form'>
                    <div className='form-group'>
                            <label htmlFor="id">Id</label>
                            <input type='text' name='id' placeholder='id' onChange={(event)=>{this.setState({id: event.target.id})}}/>
                        </div>
                        <div className='form-group'>
                            <label htmlFor="name">Name</label>
                            <input type='text' name='name' placeholder='name' onChange={(event)=>{this.setState({name: event.target.name})}}/>
                        </div>
                        <div className='form-group'>
                            <label htmlFor="email">Email</label>
                            <input type='text' name='email' placeholder='email' onChange={(event)=>{this.setState({email: event.target.email})}}/>
                        </div>
                        <div className='form-group'>
                            <label htmlFor="username">Username</label>
                            <input type='text' name='username' placeholder='username' onChange={(event)=>{this.setState({username: event.target.username})}}/>
                        </div>
                        <div className='form-group'>
                            <label htmlFor="password">Password</label>
                            <input type='password' name='password' placeholder='password' onChange={(event)=>{this.setState({password: event.target.password})}}/>
                        </div>
                    </div>
                </div>
                <div className='footer'>
                    <button type="submit" className='btn' onClick={()=>{this.forceUpdate()}}>Register</button>
                </div>
            </div>
        )
    }
}

export default Register;
